PREMIC

CREATE DATABASE PREMIC;

CREATE TABLE CLIENTE(
	IDCLIENTE INT PRIMARY KEY AUTO_INCREMENT,
	NOME VARCHAR(30) NOT NULL,
	EMAIL VARCHAR(30),
	TIPO ENUM('PF','PJ') NOT NULL
);
/* INSERCAO CLIENTE
*/

CREATE TABLE IDENTIFICADOR(
	IDIDENTIFICADOR INT PRIMARY KEY AUTO_INCREMENT,
	CPF CHAR(11),
	CNPJ CHAR(14),
	INSCRICAO_ESTADUAL VARCHAR(20),
	INSCRICAO_MUNICIPAL VARCHAR(20),
	IDCLIENTE INT UNIQUE,
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDCLIENTE) REFERENCES CLIENTE(IDCLIENTE)
);
/* INSERCAO IDENTIFICADOR
*/

CREATE TABLE ENDERECO(
	IDENDERECO INT PRIMARY KEY AUTO_INCREMENT,
	TIPO ENUM('OBRA', 'SEDE') NOT NULL,
	LOGRADOURO VARCHAR(30),
	DESCRICAO VARCHAR(30),
	NUMERO VARCHAR(10),
	BAIRRO VARCHAR(30),
	CEP CHAR(8),
	CIDADE VARCHAR(30),
	ESTADO CHAR(2),
	COMPLEMENTO VARCHAR(30),
	IDCLIENTE INT,
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDCLIENTE) REFERENCES CLIENTE(IDCLIENTE)
);
/*INSERCAO ENDERECO

*/

CREATE TABLE TELEFONE(
	IDTELEFONE INT PRIMARY KEY AUTO_INCREMENT, 
	TIPO ENUM('RES','COM','CEL') NOT NULL,
	DDD CHAR(3) NOT NULL,
	NUMERO VARCHAR(10) NOT NULL,
	IDCLIENTE INT,

	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDCLIENTE) REFERENCES CLIENTE(IDCLIENTE)
);
/*INSERÇÃO TELEFONE
*/

CREATE TABLE CATEGORIA_PRODUTO(
	IDCATEGORIA_PRODUTO INT PRIMARY KEY AUTO_INCREMENT, 
	DESCRICAO VARCHAR(30) NOT NULL UNIQUE
);
/*INSERCAO CATEGORIA_PRODUTO
*/

CREATE TABLE UNIDADE_PRODUTO(
	IDUNIDADE_PRODUTO INT PRIMARY KEY AUTO_INCREMENT, 
	SIGLA VARCHAR(3) NOT NULL UNIQUE,
	MEDIDA VARCHAR(30) NOT NULL UNIQUE
);
/*INSERCAO UNIDADE_PRODUTO

*/

CREATE TABLE PRODUTO(
	IDPRODUTO INT PRIMARY KEY AUTO_INCREMENT, 
	DESCRICAO VARCHAR(50) NOT NULL UNIQUE,
	IDCATEGORIA_PRODUTO INT,
	IDUNIDADE_PRODUTO INT,
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDCATEGORIA_PRODUTO) REFERENCES CATEGORIA_PRODUTO(IDCATEGORIA_PRODUTO),
	FOREIGN KEY(IDUNIDADE_PRODUTO) REFERENCES UNIDADE_PRODUTO(IDUNIDADE_PRODUTO)
);
/*INSERCAO PRODUTO

*/

CREATE TABLE PEDIDO(
	IDPEDIDO INT PRIMARY KEY AUTO_INCREMENT, 
	DATA_PEDIDO DATE NOT NULL,
	DATA_PREVISAO_ENTREGA DATE NOT NULL,
	OBSERVACAO VARCHAR(100),
	FRETE ENUM("CIF","FOB") NOT NULL,
	STATUS ENUM("ENTREGUE", "PENDENTE", "PARCIAL") NOT NULL,
	IDENDERECO INT,
	IDCLIENTE INT,
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDENDERECO) REFERENCES ENDERECO(IDENDERECO),
	FOREIGN KEY(IDCLIENTE) REFERENCES CLIENTE(IDCLIENTE)
);

CREATE TABLE ITEM_DE_PEDIDO(
	IDITEM_PEDIDO INT PRIMARY KEY AUTO_INCREMENT, 
	IDPRODUTO INT,
	IDPEDIDO INT,
	QUANTIDADE FLOAT(10,2),
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDPRODUTO) REFERENCES PRODUTO(IDPRODUTO),
	FOREIGN KEY(IDPEDIDO) REFERENCES PEDIDO(IDPEDIDO)
);

CREATE TABLE SAIDA(
	IDSAIDA INT PRIMARY KEY AUTO_INCREMENT, 
	DATA_SAIDA DATE NOT NULL,
	NUMERO_NOTA_FISCAL VARCHAR(30),
	OBSERVACAO VARCHAR(100),
	IDPEDIDO INT,
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDPEDIDO) REFERENCES PEDIDO(IDPEDIDO)
);

CREATE TABLE ITEM_DE_SAIDA(
	IDITEM_SAIDA INT PRIMARY KEY AUTO_INCREMENT, 
	IDPRODUTO INT,
	IDSAIDA INT,
	QUANTIDADE FLOAT(10,2),
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDPRODUTO) REFERENCES PRODUTO(IDPRODUTO),
	FOREIGN KEY(IDSAIDA) REFERENCES SAIDA(IDSAIDA)
);

CREATE TABLE ENTRADA(
	IDENTRADA INT PRIMARY KEY AUTO_INCREMENT, 
	DATA_ENTRADA DATE NOT NULL,
	TIPO ENUM("COMPRA", "PRODUÇÃO") NOT NULL,
	OBSERVACAO VARCHAR(100)
);

CREATE TABLE ITEM_DE_ENTRADA(
	IDITEM_ENTRADA INT PRIMARY KEY AUTO_INCREMENT, 
	IDPRODUTO INT,
	IDENTRADA INT,
	QUANTIDADE FLOAT(10,2),
	
	/*REGRAS DA TABELA*/
	FOREIGN KEY(IDPRODUTO) REFERENCES PRODUTO(IDPRODUTO),
	FOREIGN KEY(IDENTRADA) REFERENCES ENTRADA(IDENTRADA)
);

/*TESTES*/

SELECT P.ID_PRODUTO, P.DESCRICAO, U.SIGLA AS UN, CAT.DESCRICAO AS GRUPO
FROM TB_PRODUTO P
	INNER JOIN TB_CATEGORIA_PRODUTO CAT
	ON P.ID_CATEGORIA_PRODUTO = CAT.ID_CATEGORIA_PRODUTO
	INNER JOIN TB_UNIDADE_PRODUTO U
	ON P.ID_UNIDADE_PRODUTO = U.ID_UNIDADE_PRODUTO;

SELECT P.IDPRODUTO, P.DESCRICAO, U.SIGLA AS UN, CAT.DESCRICAO AS GRUPO
FROM PRODUTO P
	INNER JOIN CATEGORIA_PRODUTO CAT
	ON P.IDCATEGORIA_PRODUTO = CAT.IDCATEGORIA_PRODUTO
	INNER JOIN UNIDADE_PRODUTO U
	ON P.IDUNIDADE_PRODUTO = U.IDUNIDADE_PRODUTO
WHERE CAT.DESCRICAO = "PERGOLA CONCRETO";

SELECT C.IDCLIENTE, C.NOME, I.CPF, C.EMAIL, I.CNPJ
FROM CLIENTE C
	INNER JOIN IDENTIFICADOR I
	ON C.IDCLIENTE = I.IDCLIENTE
WHERE C.TIPO = "PF"
ORDER BY C.NOME;

SELECT C.IDCLIENTE, C.NOME, I.CNPJ, I.INSCRICAO_ESTADUAL, I.INSCRICAO_MUNICIPAL ,C.EMAIL, I.CPF
FROM CLIENTE C
	INNER JOIN IDENTIFICADOR I
	ON C.IDCLIENTE = I.IDCLIENTE
WHERE C.TIPO = "PJ"
ORDER BY C.NOME;

SELECT IDCLIENTE, COUNT(*)
FROM TELEFONE
GROUP BY IDCLIENTE;

SELECT IDCLIENTE , COUNT(*)
FROM ENDERECO
GROUP BY IDCLIENTE;

SELECT E.TIPO, C.IDCLIENTE, C.NOME, I.CPF, C.EMAIL, T.TIPO, T.DDD, T.NUMERO, E.CIDADE, E.ESTADO
FROM CLIENTE C
	INNER JOIN IDENTIFICADOR I
	ON C.IDCLIENTE = I.IDCLIENTE
	INNER JOIN TELEFONE T
	ON C.IDCLIENTE = T.IDCLIENTE
	INNER JOIN ENDERECO E
	ON C.IDCLIENTE = E.IDCLIENTE
WHERE C.TIPO = "PF" AND T.TIPO = "CEL";

SELECT E.TIPO, E.LOGRADOURO, E.DESCRICAO, E.NUMERO,E.BAIRRO, E.COMPLEMENTO, E.CIDADE, E.ESTADO, E.CEP
FROM CLIENTE C
	INNER JOIN ENDERECO E
	ON C.IDCLIENTE = E.IDCLIENTE
WHERE C.IDCLIENTE = "01" AND E.TIPO = "OBRA";

SELECT C.NOME, E.ESTADO, T.DDD, T.NUMERO
FROM CLIENTE C
	INNER JOIN ENDERECO E
	ON C.IDCLIENTE = E.IDCLIENTE
	INNER JOIN TELEFONE T
	ON C.IDCLIENTE = T.IDCLIENTE
WHERE E.ESTADO = "SE" AND T.TIPO = "CEL";
	
/*ENDERECOS POR ESTADO*/
SELECT E.ESTADO, COUNT(*) AS QTDE
FROM ENDERECO E
GROUP BY E.ESTADO
ORDER BY QTDE;

/*CLIENTES UNICOS POR ESTADO*/
SELECT E.ESTADO, COUNT(DISTINCT C.NOME) AS QTDE
FROM CLIENTE C
	INNER JOIN ENDERECO E
	ON C.IDCLIENTE = E.IDCLIENTE
GROUP BY E.ESTADO
ORDER BY E.ESTADO;

/*CLIENTES DE UM ESTADO ESPECIFICO*/
SELECT C.IDCLIENTE, C.NOME, E.ESTADO 
FROM CLIENTE C
	INNER JOIN ENDERECO E
	ON C.IDCLIENTE = E.IDCLIENTE
WHERE E.ESTADO = "SC" AND E.TIPO = "OBRA"
ORDER BY C.IDCLIENTE;

