/*PESQUISAR POR CNPJ*/
SELECT *
FROM TB_CLIENTE C
INNER JOIN  tb_cliente_pj J
ON C.ID_CLIENTE = J.ID_CLIENTE
WHERE C.ID_CLIENTE = (SELECT PJ.ID_CLIENTE
                      FROM tb_cliente_pj PJ
                      WHERE PJ.CNPJ = '42965354000152');
					  
					  
/*PRODUTOS DE UM PEDIDO X*/					  
SELECT P.DESCRICAO,
       E.quantidade,
       E.id_entrada AS PEDIDO
FROM tb_produto P
    INNER JOIN tb_item_entrada E
    ON P.ID_PRODUTO = E.id_produto
WHERE E.id_entrada = 1;

/*PEDIDOS DE UM PRODUTO X*/
SELECT I.id_entrada AS ORDER_ENTRADA,
       I.data_entrada,
       I.tipo_entrada,
       E.quantidade
FROM tb_entrada I
    INNER JOIN tb_item_entrada E
    ON I.id_entrada = E.id_entrada
WHERE E.id_produto = (SELECT P.ID_PRODUTO 
					  FROM tb_produto P 
					  WHERE P.DESCRICAO  = 'BANCO DE CONCRETO 1,60M');